import React from 'react';

const VerifyVoters = (props)=>{
    return (<>

        {props.voterList.map((voter)=>{
            return (<h2>{voter.name} {voter.votingCardNumber} {voter.constituency} verifid:{voter.hasVerified.toString()} voted :{voter.hasVoted.toString()}</h2>);
        })}

       </>);
}
export default  VerifyVoters;
